export default props =>
  <div className='App'>
    <div className='App-header'>
      <h1>Care to inspect colors?</h1>
      <label htmlFor='single'>
          <img src={logo} className="App-logo" alt="logo" />
      </label>
      <input type='file' id='single' onChange={props.onChange} />
    </div>
  </div>


